@IlhanMN My entire life, my mother has stayed quiet and gracious while otherwise good people told her she was going to hell for being Muslim. 

These last 4 yrs, she’s been a beacon of calm to offset my rage. 

This morning, my mother belly danced through the house at the news Biden won.

@Kitty2Karen All the rage now by Trump supporters is going to be aimed squarely at the media that lied for years about Russian collusion.

Sports leagues and their political nonsense have turned off fans. Hollywoood and their SJW crap have emptied theaters.

All of them are gonna lose big $
